    contribution and are sending the FEC a copy of that check by mail.  2. H6 payments
    for Phone Calls and Postage did not refer to federal candidates and the entries
    have been corrected.  3. The payment for Phone Services was an in-kind contribution
    from the DCCC. This activity did not mention any federal candidate and the entry
    has been corrected.  4. Report ammended to include occupation and employer for
    these Levin donations.  5. Ashtabula County Women Democrats and Cuyahoga Democratic
    Women's Caucus donations came from their PAC's operated independently from Local
    Political Parties. The other donations were included in the transfer out noted
    in our response to the October Monthly Report.  6. No funds from other poliotical
    parties were used to pay the Federal component of these activities.  7. The H4
    payments for Salary did not qualify as FEA and the entry has been corrected.  8.
    No transfers from the National Party Committees were used for any of the listed
    activities. We maintain a separate account for these transfers to ensure this
    does not occur.  \n"
